products.sort()
n = len(products)

def get_lower_bound(products, sub_search):
    start, end = 0, n - 1
    while start < end:
        mid = (end + start) // 2
        if products[mid] == sub_search:
            return mid
        elif products[mid] < sub_search:
            start = mid + 1
        else:
            end = mid - 1
    return start


